Text:
@MaGicbush @dropdead.betty

A couple of things...The only way to obtain an accurate assessment of a percentage or chance of spotting "a gay" (as you so both so eloquently  presented it) would be to ask every single person their sexual preference and expect every single person to answer honestly. The majority of gay people are actually quite private about it, for fear of ridicule, imagine that?)  Many recent studies have suggested that 1 out of every 10 is "a gay".  (I'm sure give or take your part-timers, transgender, and the occasional "I experimented in college once") It's subjective.  My father, a two-time purple heart recipient happens to be "a gay" and I never had any issues with it as a child, and neither does my daughter.  I'm not saying force your children to be educated on sexuality, but I didn't have a hard time understanding that it was okay for a human to love another human, and his granddaughter understands as well.  I just wanted to share a different perspective.  I'm sure my post is going to garner some attention from some trolls, but I don't mind, I have a sense of humor. :-P

  By the way, thanks scene for this upload, my dance students love this movie!
